import styled from "styled-components";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/effect-coverflow";
import "swiper/css/pagination";
import "./styles.css";
import { EffectCoverflow, Pagination, Navigation, EffectFlip } from "swiper";

function Animation() {
  return (
    <>
      <Swiper
        effect={"flip"}
        grabCursor={true}
        pagination={true}
        navigation={true}
        modules={[EffectFlip, Pagination, Navigation]}
        className="mySwiper"
      >
        <SwiperSlide>
          <img src="weather1.jpg" />
        </SwiperSlide>
        <SwiperSlide>
          <img src="weather2.JPG" />
        </SwiperSlide>
        <SwiperSlide>
          <img src="weather3.JPG" />
        </SwiperSlide>
        <SwiperSlide>
          <img src="weather4.jpg" />
        </SwiperSlide>
        <SwiperSlide>
          <img src="weather5.JPG" />
        </SwiperSlide>
      </Swiper>
    </>
  );
}
export default Animation;
